let watched = new Set(JSON.parse(localStorage.getItem('nf_v4') || '[]'));
let filter = 'all', query = '', kindF = 'all';

const totalMovies = FILMS.filter(f => f.k === 'movie').length;
const totalSeries = FILMS.filter(f => f.k === 'series').length;

function save() { localStorage.setItem('nf_v4', JSON.stringify([...watched])); }

function updateStats() {
  const total = FILMS.length, w = watched.size, pct = total ? Math.round(w / total * 100) : 0;
  document.getElementById('wCount').textContent = w;
  document.getElementById('mCount').textContent = totalMovies.toLocaleString();
  document.getElementById('sCount').textContent = totalSeries.toLocaleString();
  document.getElementById('tCount').textContent = total.toLocaleString();
  document.getElementById('rCount').textContent = (total - w).toLocaleString();
  document.getElementById('pPct').textContent = pct + '%';
  document.getElementById('pFill').style.width = pct + '%';
}

function applyFilters() {
  const q = query.toLowerCase();
  let vis = 0;
  document.querySelectorAll('.movie').forEach(el => {
    const id = +el.dataset.idx;
    const f = FILMS[id];
    const isW = watched.has(id);
    const mQ = !q || f.t.toLowerCase().includes(q) || f.c.toLowerCase().includes(q);
    const mF = filter === 'all' || (filter === 'watched' && isW) || (filter === 'unwatched' && !isW);
    const mK = kindF === 'all' || f.k === kindF;
    if (mQ && mF && mK) { el.classList.remove('hidden'); vis++; }
    else el.classList.add('hidden');
  });
  document.getElementById('noRes').style.display = vis ? 'none' : 'block';
}

function toggle(el) {
  const id = +el.dataset.idx;
  el.classList.add('popping');
  setTimeout(() => el.classList.remove('popping'), 120);
  if (watched.has(id)) { watched.delete(id); el.classList.remove('watched'); }
  else { watched.add(id); el.classList.add('watched'); }
  save();
  updateStats();
  if (filter !== 'all') applyFilters();
}

function build() {
  const grid = document.getElementById('mainGrid');
  const frag = document.createDocumentFragment();
  FILMS.forEach((f, idx) => {
    const el = document.createElement('div');
    const isSeries = f.k === 'series';
    el.className = 'movie' + (isSeries ? ' is-series' : '') + (watched.has(idx) ? ' watched' : '');
    el.dataset.idx = idx;
    const meta = [f.y, f.l, f.r].filter(Boolean).join(' · ');
    const imdb = f.i ? `<span class="imdb">★ ${f.i}</span>` : '';
    const badge = `<span class="kbadge ${f.k}">${isSeries ? 'série' : 'film'}</span>`;
    el.innerHTML = `
      <div class="cb"></div>
      <div class="minfo">
        <div class="mtitle">${f.t.replace(/</g, '&lt;')}</div>
        <div class="mmeta">${badge}${meta ? '<span>' + meta + '</span>' : ''}${imdb}</div>
      </div>`;
    el.addEventListener('click', () => toggle(el));
    frag.appendChild(el);
  });
  grid.appendChild(frag);
}

build();
updateStats();

let st;
document.getElementById('searchInput').addEventListener('input', e => {
  clearTimeout(st);
  st = setTimeout(() => { query = e.target.value; applyFilters(); }, 200);
});

document.querySelectorAll('.btn[data-f]').forEach(btn => {
  btn.addEventListener('click', () => {
    document.querySelectorAll('.btn[data-f]').forEach(b => b.classList.remove('on'));
    btn.classList.add('on');
    filter = btn.dataset.f;
    applyFilters();
  });
});

document.querySelectorAll('.btn[data-k]').forEach(btn => {
  btn.addEventListener('click', () => {
    document.querySelectorAll('.btn[data-k]').forEach(b => b.classList.remove('on', 'series-on'));
    const k = btn.dataset.k;
    btn.classList.add(k === 'series' ? 'series-on' : 'on');
    kindF = k;
    applyFilters();
  });
});

document.getElementById('resetBtn').addEventListener('click', () => {
  if (!confirm('Réinitialiser toute ta progression ?')) return;
  watched.clear();
  save();
  document.querySelectorAll('.movie.watched').forEach(el => el.classList.remove('watched'));
  updateStats();
});
